import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    viewInput:{
      height:'10%',
      width:'100%',
      alignItems: 'center',
      justifyContent: 'center',
    },
    input:{
      height:'40%',
      width:'55%',
      borderWidth:1,
      borderColor:'#d2982e',
      borderRadius:10,
      marginTop:3,
    },
    buttonLogin:{
      color:'#ffa500'	,
      borderWidth: 1,

      height:'40%',
      width:'55%',
    },
  });
